_G.DevnsKassadin_DisableSkins = false
_G.DevnsKassadin_DisableLevelSpell = false

if (myHero.charName ~= "Kassadin") then return end
assert(load(Base64Decode(""), nil, "bt", _ENV))()

---//==================================================\\---
--|| > Script Variables                                 ||--
---\\==================================================//---

_ENV.ScriptName = "Devn's Kassadin"
_ENV.ScriptFullName = ScriptName.." - The Void God"
_ENV.ScriptVariables = "DevnsKassadin"
_ENV.CurrentVersion = "1.02"
_ENV.BuildDate = "2015/08/19"
_ENV.LeagueVersion = "5.15 HF"
_ENV.StatusKey = "VILKQQOKOHN"

_ENV.UpdatePath = "DevnBoL/BoL1.0Scripts/master/DevnsKassadin/"

local Config = nil
local Selector = nil
local Target = nil
local Readme = nil
local Changelog = nil
local Items = nil
local ResetTarget = nil

AddRequiredLibrary("SxOrbWalk", "http://raw.githubusercontent.com/Superx321/BoL/master/common/SxOrbWalk.lua")
AddRequiredLibrary("VPrediction", "https://raw.githubusercontent.com/SidaBoL/Scripts/master/Common/VPrediction.lua", true)
