---//==================================================\\---
--|| > Callback Handlers                                ||--
---\\==================================================//---

Callbacks:Bind("Load", function()
	SetupVariables()
	SetupConfig()
end)
Callbacks:Bind("Tick", function()
	ShowReadme()
	UpdateModes()
	if (myHero.dead) then return end
	UpdateTarget()
	if (IsEvading() or Orbwalker:IsAttacking()) then return end
	Killsteal()
	PerformModes()
end)
Callbacks:Bind("Draw", function()
	DrawPermaShow()
	if (myHero.dead or Config.Drawing.Disabled) then return end
	DrawRanges()
end)
Callbacks:Bind("ProcessSpell", function(unit, spell)
	if (not unit or not spell.name) then return end
	if (unit.isMe and (spell.name == myHero:GetSpellData(_W).name)) then
		Orbwalker:ResetAutoAttack()
	end
end)
Callbacks:Bind("AfterAttack", function(target)
	if (not Spells.W.Ready) then return end
	if (ResetTarget) then
		local rtarget = ResetTarget
		ResetTarget = nil
		if (Spells.W:InRange(rtarget)) then
			NetherAttack(rtarget)
			return
		end
	end
	if ((Config.Keys.Combo and HaveEnoughMana(Config.Combo.WMana)) or (Config.Keys.Harass and HaveEnoughMana(Config.Harass.WMana))) then
		local target = Selector:GetTarget(Spells.W.Range)
		if (target) then
			NetherAttack(target)
		end
	end
end)

---//==================================================\\---
--|| > Main Script Functions                            ||--
---\\==================================================//---

function ShowReadme()
	if (JustUpdated) then
		local title = Changelog.Title
		Changelog.Title = "Updated to v"..CurrentVersion
		Changelog.Callback = function() Changelog.Title = title end
		Changelog:Show()
		JustUpdated = false
		return
	end
	if (not Config.Misc.Readme) then return end
	Config.Misc.Readme = false
	Config.Misc:save()
	if (Readme.Visible or Changelog.Visible) then return end
	Readme:Show()
end
function UpdateModes()
	if (SacLoaded and Config.Orbwalker.Bind) then
		Config.Keys.Combo = _G.AutoCarry.Keys.AutoCarry
		Config.Keys.Harass = _G.AutoCarry.Keys.MixedMode
		if (Config.Keys.Combo and Target) then
			Config.Keys.Harass = false
		end
		SetKeysConfig(Config.Keys)
	end
end
function UpdateTarget()
	Target = Selector:GetTarget(Spells.Q.Range)
	Orbwalker:ForceTarget(Target)
end
function Killsteal()
	local config = Config.Killstealing
	if (not config.Enabled or (config.RecallDisable and Recalling)) then return end
	if (not config.W and not config.E) then return end
	for _, enemy in ipairs(GetEnemiesInRange(Spells.W.Range)) do
		if (config.W and Spells.W.Ready and HaveEnoughMana(config.WMana) and Spells.W:WillKill(enemy) and Spells.W:InRange(enemy)) then
			NetherAttack(enemy)
			return
		end
		if (config.E and Spells.E.Ready and HaveEnoughMana(config.EMana) and Spells.E:WillKill(enemy)) then
			Spells.E:CastAt(enemy)
			return
		end
		if (config.Q and Spells.Q.Ready and HaveEnoughMana(config.QMana) and Spells.Q:WillKill(enemy)) then
			Spells.Q:Cast(enemy)
			return
		end
	end
end
function PerformModes()
	if (not Target) then return end
	if (Config.Keys.Combo) then CastSpells(Config.Combo) end
	if (Config.Keys.Harass) then CastSpells(Config.Harass) end
end

function CastSpells(config)
	if (config.E and Spells.E.Ready and HaveEnoughMana(config.EMana)) then
		Spells.E:CastAt(Target)
	end
	if (config.Q and Spells.Q.Ready and HaveEnoughMana(config.QMana)) then
		Spells.Q:Cast(Target)
	end
	if (config.W and Spells.W.Ready and HaveEnoughMana(config.WMana) and (#GetEnemiesInRange(Spells.W.Range) > 0)) then
		local target
		if (Spells.AA:InRange(Target)) then
			target = Target
			Items:CastOffensive(Target, config)
		else
			target = Selector:GetTarget(Spells.W.Range)
		end
		if (target) then
			if (Orbwalker:CanAttack() and Spells.AA:InRange(target)) then
				ResetTarget = target
				Orbwalker:Attack(target)
			else
				NetherAttack(target)
			end
		end
	end
end
function NetherAttack(unit)
	Spells.W:Cast()
	Orbwalker:Attack(unit)
end

