function SetupKeysConfig()
	if (not SacLoaded or not Config.Orbwalker.Bind) then
		local config = Config:Menu("Keys", "Script Key-Bindings")
		local toggles = config:Menu("Toggles", "Toggle Settings")
		toggles:Toggle("Combo", "Make Combo Mode a Toggle", false)
		toggles:Toggle("Harass", "Make Harass Mode a Toggle", false)
		toggles:Separator()
		toggles:Note("Requires reload.")
		config:Separator()
		config[toggles.Combo and "KeyToggle" or "KeyBinding"](config, "Combo", "Combo Mode", false, 32)
		config[toggles.Harass and "KeyToggle" or "KeyBinding"](config, "Harass", "Harass Mode", false, "T")
		SetKeysConfig(config)
	else
		Config.Keys = {
			Combo = false,
			Harass = false,
		}
	end
end
